var countbox = ".svgBlock"; // html block branch portfolio brown
var countbox2 = ".svgBlock2"; //  html block branch about black
var countbox3 = ".svgBlock3"; // html block  branch team black
var countbox4 = ".svgBlock4"; // html block  branch contact brown
var countbox5 = ".svgBlock5"; // html block long black branch



function animate(svgElement, svgElement2, count) {
    var show = true;
    $(window).on("scroll load resize", function () {
        var w_top = $(window).scrollTop(); //The number of pixels on the page that has been scrolled
        var e_top = $(count).offset().top; //The distance from the block with counters to the top of the document
        var w_height = $(window).height(); // window height
        var d_height = $(document).height(); //document height
        var e_height = $(count).outerHeight(); //full height with counters

        if ((w_top + w_height) > e_top && w_top < (e_top + e_height)) {
            if (show) {
                $(count).append(svgElement, svgElement2);
                show = false;
            }
        } else {
            show = true;
            $(count + ' > svg').remove();
            //   $(count + '.right').remove();
        }
    });
}

animate(branch_left, branch_right, countbox);
animate(branch_left_black, branch_right_black, countbox2);
animate(branch_left_black, branch_right_black, countbox3);
